    return (
    <div className = "navbar"> 
        <div className = "nav-logo">


            <img onClick = {Home} src= "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQJYctcCNdEo8tPvMXckYVI7kehiKtMd6sBRQ&usqp=CAU" />


        </div>
        <div className = "nav-name">
        <h1>Freaqy</h1>
        </div>
        <div onClick = {Home}className = "nav-courses">
            {/* navigate(/Courses) */}
            Courses
        </div>
        <div onClick = {Languages} className = "nav-home">
            New Languages
        </div>


        <div onClick = {Login} className = "login">
        {user ? "Logout": "Login"}   
        </div>

    </div>
    )

}
export default Navbar;
